// pages/about.js
import React from 'react'
import Link from 'next/link'
import Router, { withRouter } from 'next/router'

const href = {
  pathname: '/about',
  query: { name: 'zeit' }
}

const as = {
  pathname: '/about/zeit',
  hash: 'title-1'
}

const handleClick = () => Router.push(href, as)

function About() {
  return <p>Welcome to About!</p>;
}

export default About;
